import './App.css';
import Read from './components/combos/read.js';
import Create from './components/combos/create.js';
import Update from './components/combos/update.js';
import { BrowserRouter as Router , Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>


          <div className='main'>
          <h2 className='mian-header'> Combos </h2>
          <Link to='/create'>
            <button>Crear usuario</button>
          </Link>

          <div>

              <Route path="/create" elem={Create}></Route> 

          </div>


          <div>

              <Route exact path="/read" Component={Read}></Route> 

          </div>



          <div>

              <Route path="/upddte" Component={Update}></Route> 

          </div>
        </div>


    </Router>
  );
}

export default App;
